import "./Navbar.css";

const Navbar = () => {
  const navigations = [
    {
      name: "About",
      url: "about.html",
      subLinks: [
        {
          name: "Legacy & Milestones",
          url: "about.html#Legacy",
          subLink: [
            { name: "Our Vision", url: "#vision" },
            { name: "Our Mission", url: "#mission" },
          ],
        },
        {
          name: "Team",
          url: "about.html#team",
          subLink: [
            { name: "Doctors", url: "#doctors" },
            { name: "Staff", url: "#staff" },
          ],
        },
      ],
    },
    {
      name: "Specialties",
      url: "specialties.html",
      subLinks: [
        {
          name: "Orthopaedics",
          url: "specialties.html#ortho",
          subLink: [
            { name: "Knee", url: "#knee" },
            { name: "Shoulder", url: "#shoulder" },
          ],
        },
        {
          name: "Neuro",
          url: "specialties.html#neuro",
          subLink: [
            { name: "Spine", url: "#spine" },
            { name: "Brain", url: "#brain" },
          ],
        },
      ],
    },
  ];

  return (
    <header className="main-header">
      <div className="header-sticky">
        <nav className="navbar navbar-expand-lg">
          <div className="container">
            <a
              className="navbar-brand"
              href="https://www.mrityunjayhospital.com"
            >
              <img
                src="https://sangeetamedicalcentre.com/wp-content/uploads/2023/08/Asset-4.png"
                alt="Mrityunjay Orthopaedic Hospital Logo"
                style={{ width: "200px" }}
              />
            </a>

            <div className="collapse navbar-collapse main-menu">
              <div className="nav-menu-wrapper">
                <ul className="navbar-nav mr-auto" id="menu">
                  {navigations.map((navigation, index) => (
                    <li className="nav-item submenu" key={index}>
                      <a
                        className="nav-link"
                        href={navigation.url}
                        title={`About ${navigation.name}`}
                      >
                        {navigation.name}
                      </a>

                      {navigation.subLinks && (
                        <ul className="sub-menu">
                          {navigation.subLinks.map((sublink, subIndex) => (
                            <li className="nav-item" key={subIndex}>
                              <a className="nav-link" href={sublink.url}>
                                {sublink.name}
                              </a>

                              {Array.isArray(sublink.subLink) && (
                                <ul className="sub-menu">
                                  {sublink.subLink.map(
                                    (sublink2, innerIndex) => (
                                      <li className="nav-item" key={innerIndex}>
                                        <a
                                          className="nav-link"
                                          href={sublink2.url}
                                        >
                                          {sublink2.name}
                                        </a>
                                      </li>
                                    )
                                  )}
                                </ul>
                              )}
                            </li>
                          ))}
                        </ul>
                      )}
                    </li>
                  ))}
                </ul>
              </div>

              <div className="header-btn d-inline-flex">
                <a href="contact.html#Appointment" className="btn-default">
                  <span>Appointment</span>
                </a>
              </div>
            </div>

            <div className="navbar-toggle"></div>
          </div>
        </nav>

        <div className="responsive-menu"></div>
      </div>
    </header>
  );
};

export default Navbar;
